            before(function () {
                server = sinon.fakeServer.create();
                windowConfirmStub = sinon.stub(window, 'confirm');
            });

            after(function () {
                server.restore();
                windowConfirmStub.restore();
            });

            it('Try to open form', function (done) {
                var $formHolder;
                var jobPositionUrl = new RegExp('\/JobPositions\/', 'i');

                jobPositionModel = new JobPositionModel();

                jobPositionModel.urlRoot = jobPositionModel.url() + '55b92acf21e4b7c40f000017';

                server.respondWith('GET', jobPositionUrl, [200, {"Content-Type": "application/json"}, JSON.stringify(fakeJobPositionId)]);

                jobPositionModel.fetch({
                    success: function (model) {

                        formView = new FormView({
                            model    : model,
                            startTime: new Date()
                        });

                        formView.render();

                        done();
                    },

                    error: function (model, response) {
                        done(response);
                    }
                });

                server.respond();

                $formHolder = formView.$el;

                expect($formHolder).to.exist;
                expect($formHolder.find('form')).to.exist;
                expect($formHolder.find('form').attr('data-id')).to.be.equals('55b92acf21e4b7c40f000017');
            });

            it('Try to open edit form', function () {
                formView.editItem();

                expect($('.ui-dialog')).to.exist;

                $('.ui-dialog').remove();
            });

            it('Try to delete item', function () {
                var jobPositionUrl = new RegExp('\/JobPositions\/', 'i');

                windowConfirmStub.returns(true);

                server.respondWith('DELETE', jobPositionUrl, [200, {"Content-Type": "application/json"}, JSON.stringify({})]);
                formView.deleteItems();
                server.respond();

                expect(window.location.hash).to.be.equals('#tinyERP/JobPositions/list');

            });

